import React, {useState} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';

const Section = ({path, title, content}) => {
  const[status, setStatus] = setStatus(false)

  return (
    <Link to={path} className="section" dir="rtl" done={status}>
      <h1 className="section-title">{title}</h1>
      <p className="section-contant">{content}</p>
    </Link>
  );
}

export default Section;
